INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Ad esse similique qui quae.', 'Rerum ad maxime et et in veniam. Dolores et eum dicta eveniet architecto. Vero alias et reprehenderit aut nesciunt est. Totam velit enim molestias inventore ut fugiat.', 'Aut minima ullam ex. Nam aut aliquid quam error omnis ut. Voluptatem modi quod non error molestiae. Eum quia praesentium corporis enim dignissimos voluptatem.', '1976-12-19');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Enim delectus qui accusamus qui consequuntur possimus architecto.', 'Reiciendis ad fugiat quo sed modi voluptatibus magni. Sed atque blanditiis nihil vero voluptas architecto quaerat blanditiis. Dicta quia consequatur consectetur libero. Corrupti exercitationem ipsa quo dolor et ut minus.', 'Quos quisquam atque incidunt. Perspiciatis quod ut possimus neque. Adipisci quas quod voluptatem blanditiis natus error nulla. Voluptatem in culpa est et repellat explicabo adipisci omnis.', '1974-12-05');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Expedita consequatur illum occaecati odit dolore itaque doloremque.', 'Maxime officiis voluptas consectetur quae sint sint eaque. Aut id at asperiores. Est quidem libero autem odit amet aliquam qui.', 'Quia in modi rerum quo fugit aliquam. Ad ducimus quod asperiores. Adipisci sit voluptatibus aut est.', '1977-02-22');
